import React from "react";
import { Card } from "../../Card.styled";
import { ImageCard } from "../../ImageCard.styled";
import { CardSpan } from "../../CardSpan.styled";
const Grid2 = ({ content, styles }) => {
  const renderedContents = content.trendingAuctions.map((element) => {
    return (
      <Card bg={"white"} mg={"2rem 0rem"} height={"14rem"} bd={"1px solid red"}>
        <Card dp={"inline"} mg={"0.5rem"}>
          {element.tag}.
        </Card>
        <Card
          cl={styles.colors.textAlt}
          fs={"0.6rem"}
          dp={"inline-block"}
          mg={"0.5rem"}
        >
          DAY {element.day}
        </Card>
        <Card
          cl={styles.colors.textAlt}
          fs={"0.6rem"}
          dp={"inline-block"}
          mg={"0.5rem"}
          float={"right"}
        >
          {element.user}
        </Card>
        <ImageCard
          mg={"0rem 1rem"}
          dp={"inline"}
          // bg={"red"}
          src={element.image}
          height={"75%"}
          width={"75%"}
        />
        <Card mg={"0rem 1rem"} height={"10%"} bd={"1px solid red"}>
          <CardSpan float={"left"} fs={"0.5rem"}>
            {element.RemainingTime}
          </CardSpan>
          <CardSpan float={"right"} fs={"0.5rem"}>
            {element.value}
          </CardSpan>
          <br />
          <Card
            fs={"0.3rem"}
            color={styles.colors.textAlt}
            ps={"relative"}
            pstp={"-0.5rem"}
          >
            <CardSpan float={"left"} fs={"0.5rem"}>
              RemainingTime
            </CardSpan>
            <CardSpan float={"right"} fs={"0.5rem"}>
              HighestBid
            </CardSpan>
          </Card>
        </Card>
      </Card>
    );
  });
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card dp={"grid"} gridC={"27% 27% 27%"} gridjc={"space-between"}>
          {renderedContents}
        </Card>
      </Card>
    </>
  );
};

export default Grid2;
